import { connect } from "inferno-redux";
import {
  addTodo,
  getTodo,
  editTodo,
  getTodos,
  deleteTodo
} from "../actions/todoActions";

const IndividualTodo = ({ todo }) => (
  <div>
    <ul>{console.log(todo.todos)}</ul>
  </div>
);

const mapStateToProps = state => ({
  todo: state.todo
});

export default connect(
  mapStateToProps,
  { addTodo, getTodo, editTodo, getTodos, deleteTodo }
)(IndividualTodo);
